import React from 'react'

const ComboBox = () => {
    return(
        <select>
            <option value="CE">Computer Engineering</option>
            <option value="CS">Cyber Security</option>
            <option value="BA">Business Administration</option>
            <option value="DE">Department of Economics</option>
        </select>
    )
}
